import React from 'react';
import ReactDOM  from 'react-dom';
import Heading from './Heading'
import List from './List';
import Para from './Para';

function App(){
    return (
        <>
        <Heading/>
            <Para/>
            <List/>
        </>
    );
}

export default App;
